import React from 'react'
import { useDispatch } from 'react-redux'
import { SetPageTitle } from '../../../_redux/_appStateStore/appStoreAccessor';
import { ILogmessage } from './interfaces/ILogmessage';
import LogTable from '../../../_components/_virtualized/_table/Table';
import { AutoSizer, Index } from 'react-virtualized';
import TableColunm from '../../../_components/_virtualized/_table/TableColunm';
import { Grid } from '@material-ui/core';

interface IProps{
    logmessages: ILogmessage[]
}

const LoggingPageContainer: React.FC<IProps> = (props) =>{

    const {logmessages} = props
    const dispatch = useDispatch();

    dispatch(SetPageTitle("Administration - Logging"))
  
    const rowGetter = React.useCallback((row: Index) =>{
        return logmessages[row.index]
    },[logmessages])

    return(
        <Grid container>
            {/* <AutoSizer>
                {({width}) =>( */}
                <LogTable 
                    height={800} 
                    width={1500} 
                    rowHeight={50} 
                    rowCount={logmessages.length} 
                    headerHeight={100}
                    logmessages={logmessages}
                    getRow={rowGetter}
                    >
                    {TableColunm({key: "0", dataKey: 'id', width: 150, headerValue:"ID" })}
                    {TableColunm({key: "1", dataKey: 'date', width: 300, headerValue: "Date"})}
                    {TableColunm({key: "2", dataKey: 'logMessageType', width: 300, headerValue: "Type"})}
                    {TableColunm({key: "3", dataKey: 'message', width: 500, headerValue: "Message"})}
                    {TableColunm({key: "4", dataKey: 'exception', width: 500, headerValue: "Exception"})}
                </LogTable>
                )}
            {/* </AutoSizer> */}
        </Grid>
    )
}

export default LoggingPageContainer
